import React, { useEffect, useState } from 'react';

function ImagesPage() {
  const [images, setImages] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/imagespage")
      .then((res) => res.json())
      .then((data) => {
        setImages(data.data);
      })
      .catch((error) => {
        console.log("Error fetching images:", error);
      });
  }, []);

  return (
    <div>
      <h1>Images Page</h1>
      {images.map((data, index) => (
        <img
          key={index}
          alt="All Images"
          width={100}
          height={100}
          src={data.image}
        />
      ))}
    </div>
  );
}

export default ImagesPage;
